import React, { Component } from "react";
import { Link } from "react-router-dom";
import "../style/Course.css";
import "../App.css";

// import { Container, Form }from 'react-bootstrap'
// import 'bootstrap/dist/css/bootstrap.min.css'



export default class Createques extends Component {

  constructor(props){
    super(props);
    this.state = {
      Email : "",
      ques : ""
    };

    this.handleOnchange = this.handleOnchange.bind(this);
    this.onSubmit = this.onSubmit(this);
  }

  handleOnchange(event){
    this.setState({ques : event.target.value})
    this.props.setQues(this.state.ques);
    console.log(this.state.ques);
    // event.preventDefault();
  }
  
  onSubmit(event){
    console.log(this.state.ques);

    // event.preventDefault();
  }

  render() {
    return (
      <>
        <br />
        <br /> <br />
        <div className="questions">
          <div className="editdetails">
            <form>
              <label forName="">Email:</label>
              <br />
              <input type="email" id="email" forName="fname" defaultValue={this.state.Email}  /> <br/>
              <br />
              <label forName="">Title:</label>
              <br />
              <input type="text" id="lname" forName="" /> <br /> <br/>
              <label forName="">Type:</label>
              <select id="level" >
                <option value="Easy"> Easy </option>
                <option value="Medium"> Medium </option>
                <option value="Hard">Hard</option>
              </select>{" "}
              <br /> <br/>
              <label forName="">Hint:</label>
              <br />
              <input type="text" id="lname" forName="" /> <br /> <br/>
              <label forName="">Related Topics:</label>
              <br />
              <input type="text" id="lname" forName="" /> <br /> <br /> <br/> 
              {/* <input type="submit" value="Submit" id="sub-btn"/>   <br/> */}
              <Link to='/practiceques'><button style={{width:"100%"}} id="sub-btn" onClick={this.onSubmit} value="Submit">  Submit </button></Link>
              </form>
          </div>
          <div className="enterquestion">
            <label forName=""> Enter Question : </label> <br />
            <textarea
              id="w3review"
              name="w3review"
              rows="13"
              cols="70"
              placeholder="Enter Questions Here"
              Value={this.state.ques}
              onChange={this.handleOnchange}
            ></textarea>
            <label forName=""> Enter Test Cases  : </label> <br />
            <textarea
              id="w3review"
              name="w3review"
              rows="7"
              cols="50"
              placeholder="Enter Test Cases Here"
            ></textarea>{" "}
            <br />
            <label forName=""> Test Cases Answer : </label> <br />
            <textarea
              id="w3review"
              name="w3review"
              rows="7"
              cols="50"
              placeholder="Enter Test Cases Answer Here"
            ></textarea>
          </div>
        </div>
      </>
    );
  }
}
